import React, { useState } from 'react';

const Questao02 = () => {
    const frente = "https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/25.png"
    const costa  = "https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/back/25.png"

    const [imagem, setImagem] = useState(frente)

    const virar = () => {
        if (imagem === frente) {
            setImagem(costa)
        } else {
            setImagem(frente)
        }
    }

    return (
        <div>
            <img 
                src={imagem}
                alt="Pikachu"
                width={200}
            />
            <button onClick={virar}>
                Virar 
            </button>
        </div>
    )
} 

export default Questao02
